import java.util.*;
import java.io.*;

public class Main {
    static class TrieNode {
        Map<Character, TrieNode> children = new HashMap<>();
        boolean isEndOfWord = false;
    }

    static TrieNode buildTrie(String s) {
        TrieNode root = new TrieNode();
        for (char c : s.toCharArray()) {
            TrieNode node = root;
            for (int i = 0; i < c - 'a'; i++) {
                if (!node.children.containsKey('a' + i)) {
                    node.children.put('a' + i, new TrieNode());
                }
                node = node.children.get('a' + i);
            }
            node.isEndOfWord = true;
        }
        return root;
    }

    static void dfs(TrieNode node, StringBuilder path, List<String> res) {
        if (node.isEndOfWord) {
            res.add(path.toString());
        }
        for (Map.Entry<Character, TrieNode> entry : node.children.entrySet()) {
            path.append(entry.getKey());
            dfs(entry.getValue(), path, res);
            path.deleteCharAt(path.length() - 1);
        }
    }

    public static void main(String[] args) throws IOException {
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        while (true) {
            String s = br.readLine();
            if (s.equals("#")) {
                break;
            }
            TrieNode root = buildTrie(s);
            List<String> res = new ArrayList<>();
            dfs(root, new StringBuilder(), res);
            Collections.sort(res);
            int n = res.size();
            System.out.println(n);
            if (n <= 10) {
                for (String str : res) {
                    System.out.println(str);
                }
            } else {
                for (int i = 0; i < 5; i++) {
                    System.out.println(res.get(i));
                }
                for (int i = n - 5; i < n; i++) {
                    System.out.println(res.get(i));
                }
            }
        }
    }
}
